import { Link } from "react-router-dom";
const MainPage = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/welcome"> Welcome Page by Link</Link>
        </li>

        <li>
          <Link to="/product"> Product Page by Link</Link>
        </li>
      </ul>
    </nav>
  );
};

export default MainPage;
